import React, { FC } from 'react'
import style from './Button.css'

export interface IButtton {
    onClick?: Function,
    label?: string,
    background?: any,
    color?: string,
    width?: number
    padding: number
}

const FormButton:FC<IButtton> = ({onClick, label, background, width, padding, color}) => {
  const Button = style(background, width, padding )
  return <Button className={background && 'bg-color'}>{label}</Button>
}

export default FormButton
